window.bookSummaryJSON = "<p><b>Rudely yanked from cryo-sleep to find herself among a crew of modded humans in deep space, and on a burning spaceship, no less, Daisy's world just got a whole lot more complicated. And it was only going to get worse.</b>&nbsp;</p> <p>As if the creepy cyborg and the mechanically-enhanced human crew weren't bad enough, what was supposed to be a simple flight home to Earth was going horribly wrong. A deadly plot was unfolding. One that could jeopardize the entire human race. And Daisy found herself stuck in the middle.</p> <p>It wasn't her job, saving the world, and she sure as hell didn't want it. But the snarky young woman didn't have a choice. But with Daisy reluctantly coming to the rescue, would humanity even stand a chance?</p>"; 
